import { LayoutComponents } from "../../components/LayoutComponents";
import { Link } from 'react-router-dom';
import { useState } from 'react';

export const Cadastro = () => {
    const [nome, setNome] = useState("")
    const [sobrenome, setSobrenome] = useState("")
    const [email, setEmail] = useState("")
    const [telefone, setTelefone] = useState("")
    const [cpf, setCPF] = useState("")
    const [password, setPassword] = useState("")
    const [passworddnv, setPasswordDnv] = useState("")
    return (
        <LayoutComponents>
            <form className="cadastro-form">

                <span className="cadastro-title"> Insira suas inforçaões para se cadastrar:</span>

                <div className="wrap-input">
                    <input
                        className={email !== "" ? 'has-val input' : 'input'}
                        type="email"
                        value={email}
                        onChange={e => setEmail(e.target.value)}
                    />
                    <span className="focus-input" data-placeholder="E-mail"></span>
                </div>

                <div className="wrap-input">
                    <input
                        className={email !== "" ? 'has-val input' : 'input'}
                        type="email"
                        value={email}
                        onChange={e => setEmail(e.target.value)}
                    />
                    <span className="focus-input" data-placeholder="E-mail"></span>
                </div>

                <div className="wrap-input">
                    <input
                        className={password !== "" ? 'has-val input' : 'input'}
                        type="password"
                        value={password}
                        onChange={e => setPassword(e.target.value)}
                    />
                    <span className="focus-input" data-placeholder="Senha"></span>
                </div>

                <div className='container-cadastro-form-btn'>
                    <button className='cadastro-form-btn'>Continuar</button>
                </div>

                <div className='text-entrar-conta'>
                    <span className='txt1'>Já possui conta? </span>
                    <Link className='txt2' to='/login'> Entre por aqui.</Link>
                </div>

            </form>
        </LayoutComponents>
    );
}
